<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>DT-ALG Automation Report</title>
    <style>
        *,
        *::before,
        *::after {
            box-sizing: border-box;
            padding: 0;
            margin: 0;
        }

        body {
            font-family: Arial, sans-serif;
        }

        table {
            border-collapse: collapse;
            width: 1200px;
            margin: 20px auto;
            table-layout: auto;
        }

        th,
        td {
            border: 1px solid #ccc;
            padding: 10px;
            text-align: left;
            white-space: nowrap;
        }

        th:nth-child(2),
        td:nth-child(2) {
            white-space: normal;
            width: 100%;
        }

        /* Force equal column widths for the second table */
        .equal-cols th,
        .equal-cols td {
            width: calc(100% / 5);
            text-align: center;
        }

        th {
            background-color: #f5f5f5;
        }

        .pass {
            color: green;
            font-weight: bold;
        }

        .fail {
            color: red;
            font-weight: bold;
        }

        .skip {
            color: orange;
            font-weight: bold;
        }

        .heading {
            max-width: 1200px;
            margin: 40px auto;
            font-size: 20px;
        }

        header {
            background: #4b5563;
            /* soft dark gray */
            color: #f1f5f9;
            /* very light gray */
            padding: 1rem;
            margin-bottom: 2em;
            box-shadow: 0 2px 6px rgba(0, 0, 0, 0.1);
            display: flex;
            justify-content: space-between;
            align-items: center;
        }

        h3 {
            margin-top: 1em;
            font-size: large;
            font-weight: medium;
            text-align: left;
        }

        img {
            width: 70px;
            height: 70px;
        }

        /* Collapsible styles */
        .collapsible-container {
            max-width: 1200px;
            margin: 20px auto;
        }

        .collapsible {
            border-left: 1px solid #ccc;
            margin-left: 12px;
            padding-left: 8px;
        }

        .header {
            cursor: pointer;
            display: flex;
            align-items: center;
            padding: 8px 16px;
            background-color: #f8f9fa;
            font-size: 14px;
            border-radius: 4px;
            transition: background-color 0.2s ease;
        }

        .header:hover {
            background-color: #e9ecef;
        }

        .arrow {
            display: inline-block;
            width: 14px;
            transition: transform 0.2s ease;
            font-size: 12px;
            margin-right: 6px;
            color: #0074d9;
        }

        .title {
            font-weight: 600;
            color: #333;
        }

        .content {
            display: none;
            margin-top: 4px;
            padding: 6px 10px;
            background-color: #fafafa;
            font-size: 13.5px;
            color: #444;
            border-radius: 4px;
        }

        .header.active .arrow {
            transform: rotate(90deg);
        }

        /* Log styling */
        .logs {
            background-color: #fff;
            border: 1px solid #ddd;
            padding: 6px;
            margin-top: 6px;
            border-radius: 4px;
            font-family: monospace;
            font-size: 12px;
        }

        .logs div {
            padding: 2px 0;
        }

        .time {
            color: #888;
            margin-right: 6px;
        }

        .level {
            font-size: 10px;
            font-weight: bold;
        }

        .level.INFO {
            color: #007bff;
        }

        .level.DEBUG {
            color: orange;
        }

        .level.ERROR {
            color: red;
        }

        .testcase-link {
            color: #007bff;
            text-decoration: underline;
            font-weight: bold;
            cursor: pointer;
        }
    </style>
</head>
